import java.util.*;public class Main {    public static void main(String[] args) {        Scanner in = new Scanner(System.in);        int qu[][] = new int[5][5];        for(int i = 0; i < 5; i++)            for(int j = 0; j < 5; j++)                qu[i][j] = in.nextInt();        int n = in.nextInt() - 1;        int m = in.nextInt() - 1;        for(int i = 0; i < 5; i++){            int temp = qu[n][i];            qu[n][i] = qu[m][i];            qu[m][i] = temp;        }        for(int i = 0; i < 5; i++){            for(int j = 0; j < 5; j++){                if(i == 0)                    System.out.print(qu[i][j]);                else                    System.out.print(" " + qu[i][j]);            }            System.out.println();        }    }}